import React, { useEffect } from 'react';
import Aos from 'aos';
import './About.css';
import 'aos/dist/aos.css';

function About() {
    useEffect(() => {
        Aos.init({ duration: 2000 });
    }, [])

    return (
        <section>
            {/* <span id="top">Welcome. Welcome. Welcome. Welcome.</span> */}

            <div data-aos="fade-in" class="top">
                <h1 data-aos="fade-in" id="title1">My name is Jacob Hawkins.</h1>
            </div>
        </section>
    )
}

export default About
